import React, { Component } from 'react';
import './App.css';

class App extends Component {

  componentDidMount() {
    fetch('http://127.0.0.1:1812/')
        .then(Response => Response.json())
        .then(console.log)
  }

  render() {
    return (
      <div className="App">
        <div>
          <input  type="text" placeholder="ENTER YOU AGE"></input>

          <label for="male" >Male</label>
          <input  type="radio" name="gender" value="male"></input>

          <label for="female">Female</label>
          <input  type="radio" name="gender" value="female"></input>

          <label for="other">Other</label>
          <input  type="radio" name="gender" value="other"></input>

          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
          <input  type="" ></input>
        </div>
      </div>
    );
  }
}

export default App;
